const Contact = ({contact, handleChange}) => {
    const img = contact.avatar;
    const chkBxId = `chkBx${contact.id}`;

    const toggleCheckbox = (event) => {
        console.log("xD");
    }

    return (
        <li className="contact">
            <div className="contact-element" onClick={(event) => handleChange(contact.id)} id={chkBxId}>
                {img != null ? <img src={contact.avatar} alt="new"/> : <div className="blank">NO PICTURE</div>}
            </div>
            <div className="contact-element" onClick={(event) => handleChange(contact.id)} id={chkBxId}>| {contact.first_name}</div>
            <div className="contact-element" onClick={(event) => handleChange(contact.id)} id={chkBxId}>| {contact.last_name}</div>
            <div className="contact-element">|<input type="checkbox" onClick={(event) => handleChange(contact.id)} id={chkBxId}/></div>
            
        </li>
    );
}

export default Contact;
